import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container'; 
import Row from 'react-bootstrap/Row'; 
import Col from 'react-bootstrap/Col';
function HugeHome(props) {
	return(
		<Jumbotron className=" bg-transparent jumbotron-fluid p-0">
			<Container fluid= {true}>
				<Row className = "justify-content-center ">
					<Col md = {9} sm={12}>
<h1 className = " p-lg-5 mt-5  display-4  font-weight-bolder"><small>I'M </small>THANA SHREE <small>AND I COMPLETE THINGS</small>BYTE <small> BY </small> BYTE</h1>
<h1 className = "    display-4  font-weight-light"><small>COMPLETE THINGS </small>BYTE <small>BY</small>BYTE</h1>

						{props.subTitle && <h3 className = "display-4 font-weight-light">{props.subTitle}</h3>}
						{props.text && <h3 className="lead font-weight-light">{props.text}</h3>}
					</Col>
				</Row>
			</Container>
		</Jumbotron>
	);
	
}

export default HugeHome;
